// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.16 <0.7.0;

contract Paylock {
    function signal() public {}
}

contract Rental {
    function rent_out_resource() external {}
    function retrieve_resource() external {}
}

contract Supplier {
    
    Paylock p;
    Rental r;

    enum State { Working , Completed }
    
    State st;
    
    constructor(address pp,address rr) public {
        p = Paylock(pp);
        r = Rental(rr);
        st = State.Working;
    }
    
    function finish() external {
        require (st == State.Working);
        p.signal();
        st = State.Completed;
    }
    
    function aquire_resource() external {
        r.rent_out_resource();
    }

    function return_resource() external {
        r.retrieve_resource();
    }

    event Received(address, uint);
    receive() external payable {
        emit Received(msg.sender, msg.value);
    }
}
